/**
 * Decorator to mark class as a service and store theirs instances in global variable.
 */
export function Service() {
  return function decorator(target: any) {
    // if (environment.production) return;

    setTimeout(() => {
      const WINDOW = window as any;
      const ngRef = WINDOW.ngRef;

      if (!ngRef) return;

      if (!WINDOW.SERVICES) {
        WINDOW.SERVICES = [];
      }

      WINDOW.SERVICES.push(ngRef.get(target));
    });
  };
}

// This file can be replaced during build by using the `fileReplacements` array.
// `ng build` replaces `environment.ts` with `environment.prod.ts`.
// The list of file replacements can be found in `angular.json`.

/**
 * Global environment configuration object, replaced in configurations other than development. Stores build specific data.
 */
export const environment = {
  /**
   * Whether the application is running in production mode.
   */
  production: false,

  /**
   * API URL for the backend.
   */
  apiURL: '/api',

  /**
   * Whether to disable console logging.
   */
  disableConsoleLog: false,
};

