import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { environment } from 'src/environments/environment';
import { Service } from '../decorators/service.decorator';
import { RequestOptions } from '../interfaces/request-options.interface';

/**
 * Service to access the API
 */
@Service()
@Injectable({
  providedIn: 'root',
})
export class ApiService {
  /**
   * URL of the API. Provided in the environment configuration file.
   */
  private apiURL: string = environment.apiURL;

  /** Default service constructor with `HttpClient` dependency */
  constructor(private httpClient: HttpClient) {}

  /**
   * Sends request to the API.
   * @param method HTTP method to use
   * @param url URL where to send request
   * @param options advanced options to configure request
   * @returns Request observable, which completes when request is finished
   */
  public request(method: string, url: string, options?: RequestOptions) {
    return this.httpClient.request(method, this.apiURL + url, {
      responseType: 'json',
      withCredentials: true,
      ...options,
    });
  }

  /**
   * Sends GET request to the API.
   * @param url URL where to send request
   * @param options advanced options to configure request
   * @returns Request observable, which completes when request is finished
   */
  public get(url: string, options?: RequestOptions) {
    return this.request('GET', url, options);
  }

  /**
   * Sends POST request to the API.
   * @param url URL where to send request
   * @param options advanced options to configure request
   * @returns Request observable, which completes when request is finished
   */
  public post(url: string, options?: RequestOptions) {
    return this.request('POST', url, options);
  }

  /**
   * Sends DELETE request to the API.
   * @param url URL where to send request
   * @param options advanced options to configure request
   * @returns Request observable, which completes when request is finished
   */
  public delete(url: string, options?: RequestOptions) {
    return this.request('DELETE', url, options);
  }

  /**
   * Sends PUT request to the API.
   * @param url URL where to send request
   * @param options advanced options to configure request
   * @returns Request observable, which completes when request is finished
   */
  public put(url: string, options?: RequestOptions) {
    return this.request('PUT', url, options);
  }

  /**
   * Sends PATCH request to the API.
   * @param url URL where to send request
   * @param options advanced options to configure request
   * @returns Request observable, which completes when request is finished
   */
  public patch(url: string, options?: RequestOptions) {
    return this.request('PATCH', url, options);
  }
}

import { Injectable } from '@angular/core';
import { Service } from '@main/decorators/service.decorator';
import { ApiService } from 'src/app/_main/services/api.service';

@Service()
@Injectable({
  providedIn: 'root',
})
export class AuthService {
  constructor(private apiService: ApiService) {}

  public register({
    email,
    password,
    name,
    surname,
    username,
  }: {
    email: string;
    password: string;
    name: string;
    surname: string;
    username: string;
  }) {
    return this.apiService.post(`/auth/register`, {
      body: { email, password, name, surname, username },
    });
  }

  public login({
    email,
    password,
    remember,
  }: {
    email: string;
    password: string;
    remember: boolean;
  }) {
    return this.apiService.post(`/auth/login`, { body: { email, password, remember } });
  }

  public logout() {
    localStorage.removeItem('logged');
    return this.apiService.post(`/auth/logout`, { body: {} });
  }

  public resetPassword({ email }: { email: string }) {
    return this.apiService.post(`/auth/password-reset`, { body: { email } });
  }

  public setNewPassword({ email, password }: { email: string; password: string }) {
    return this.apiService.post(`/auth/set-new-password`, { body: { email, password } });
  }

  public isLoggedIn() {
    if (localStorage.getItem('logged')) {
      return true;
    } else {
      return false;
    }
  }
}

import { Injectable } from '@angular/core';
import { CanActivate, Router } from '@angular/router';
import { AuthService } from '@auth/services/auth.service';

@Injectable({ providedIn: 'root' })
export class LoggedInUsersGuard implements CanActivate {
  constructor(private router: Router, private authService: AuthService) {}

  canActivate() {
    if (this.authService.isLoggedIn()) {
      return true;
    } else {
      this.router.navigate(['/auth/login']);
      return false;
    }
  }
}

/**
 * Utilities class with some useful methods not available in any libraries.
 */
export class Utils {
  /**
   * Function to find first occurrence of regex in string
   * @param string String to search in
   * @param regex Regex to search for
   * @param startPos Optional starting position in the string
   * @returns The index of the first match
   */
  public static regexIndexOf(string: string, regex: RegExp, startPos: number = 0) {
    var indexOf = string.substring(startPos).search(regex);
    return indexOf >= 0 ? indexOf + startPos : indexOf;
  }

  /**
   * Converts string from camelCase and PascalCase to snake_case
   * @param inputString String to convert
   * @returns string in snake_case
   */
  public static snakeCase(inputString: string) {
    return inputString
      .split('')
      .map((character, index) => {
        if (Utils.isLetter(character) && character == character.toUpperCase()) {
          if (index > 0) {
            return '_' + character.toLowerCase();
          } else {
            return character.toLowerCase();
          }
        } else {
          return character;
        }
      })
      .join('');
  }

  /**
   * Check if object has all the properties from array
   * @param object Object to check
   * @param keys keys to search for
   * @returns true if object has all of the specified properties, false otherwise.
   */
  public static has(object: any, keys: string[]) {
    for (const key of keys) {
      if (!object.hasOwnProperty(key)) {
        return false;
      }
    }
    return true;
  }

  /**
   * Checks if passed character is a letter
   * @param char Character to check
   * @returns
   */
  public static isLetter(char: String) {
    if (char.length > 1) return false;
    return (char >= 'A' && char <= 'Z') || (char >= 'a' && char <= 'z');
  }
}

import { Component, HostBinding, Input } from '@angular/core';
import { IconName, IconPrefix } from '@fortawesome/fontawesome-svg-core';
import { Utils } from '../../classes/utils.class';
import { faQuestion, IconDefinition } from '@fortawesome/free-solid-svg-icons';

/**
 * Icon component. Supports material icons and font-awesome icons.
 */
@Component({
  selector: 'app-icon',
  templateUrl: './icon.component.html',
  styleUrls: ['./icon.component.scss'],
})
export class IconComponent {
  /**
   * Icon size. Defaults to 1.5em. Supports all CSS units.
   * For example: 24px, 1.5em, etc.
   */
  @Input() size: string = '24px';

  /**
   * Icon to display. Can be a string or an icon definition.
   * For example:
   *
   * For the icon "fa fa-question" you can use:
   * ```html
   * <app-icon [icon]="faQuestion"></app-icon>
   * ```
   *
   * For the icon "mat search" you can use:
   * ```html
   * <app-icon icon="matSearch"></app-icon>
   * ```
   */
  @Input() set icon(value: string | IconDefinition) {
    this._icon = value;

    if (typeof value === 'string') {
      const splitIndex = Utils.regexIndexOf(value, /[A-Z]/);

      this.prefix = value.substring(0, splitIndex) as IconPrefix;
      this.name = value.substring(splitIndex) as IconName;
    } else {
      this.prefix = value.prefix as IconPrefix;
      this.name = value.iconName as IconName;
    }
  }

  /**
   * Icon getter
   */
  public get icon(): string | IconDefinition {
    return this._icon;
  }

  /**
   * Binding to hosts width attribute to use the size input.
   */
  @HostBinding('style.width') get width() {
    return this.size;
  }

  /**
   * Binding to the hosts height attribute to use the size input.
   */
  @HostBinding('style.height') get height() {
    return this.size;
  }

  /**
   * Getter to the icon definition. If no icon is found it returns the question icon.
   */
  public get iconDefinition(): IconDefinition {
    if (typeof this._icon === 'string') {
      return faQuestion;
    }
    return this._icon as IconDefinition;
  }

  /**
   * Style host binding to set the icon size.
   */
  public get style() {
    return {
      'font-size': this.size,
      width: this.size,
      height: this.size,
      'line-height': this.size,
    };
  }

  /**
   * Private icon variable to use getter and setter for props.
   */
  private _icon: string | IconDefinition = '';

  /**
   * Prefix getter
   */
  public prefix: IconPrefix = 'fas';

  /**
   * Name getter
   */
  public name: IconName = 'question';

  /**
   * Getter to get the icon name in snake case.
   * For example:
   *
   * for `ShoppingCart` this function will return `shopping_cart`
   */
  public get snakeCaseName(): IconName {
    return Utils.snakeCase(this.name) as IconName;
  }
}
<ng-container [ngSwitch]="prefix">
  <ng-container *ngSwitchCase="'fas'">
    <fa-icon [icon]="iconDefinition" [ngStyle]="style"></fa-icon>
  </ng-container>
  <ng-container *ngSwitchCase="'mat'">
    <mat-icon [ngStyle]="style">{{ snakeCaseName }}</mat-icon>
  </ng-container>
  <ng-container *ngSwitchCase="'cu'">
    <img [ngStyle]="style" [src]="'assets/icons/' + snakeCaseName + '.svg'" />
  </ng-container>
  <ng-container *ngSwitchDefault>
    <mat-icon [ngStyle]="style">question_mark</mat-icon>
  </ng-container>
</ng-container>

import { AfterViewInit, Directive, ElementRef } from '@angular/core';

/**
 * Directive to focus on the first input element on the page
 */
@Directive({
  selector: '[appFocusInitial]',
})
export class FocusInitialDirective implements AfterViewInit {
  /**
   * Default constructor of the directive.
   * @param el Reference to attached element
   */
  constructor(private el: ElementRef) {}

  /**
   * Lifecycle hook to initialize the directive.
   */
  ngAfterViewInit(): void {
    this.el.nativeElement.__ngContext__[33].focus();
  }
}

import { Component, HostBinding, Inject } from '@angular/core';
import { MatDialogRef, MAT_DIALOG_DATA } from '@angular/material/dialog';

/**
 * Type of the dialog variant. Used to specify what dialog styling should be used.
 */
export enum AlertDialogVariant {
  DEFAULT = 'default',
  IMPORTANT = 'important',
}

/**
 * Alert dialog data interface. Indicates what data will be passed to the dialog.
 */
export interface AlertDialogData {
  /**
   * Dialog title. Displayed at the top of the dialog.
   */
  title?: string;
  /**
   * Dialog message. Displayed below the title.
   */
  message?: string;
  /**
   * Confirm button text.
   */
  confirmText?: string;
  /**
   * Cancel button text.
   */
  cancelText?: string;
  /**
   * Type of the dialog variant. Used to specify what dialog styling should be used.
   */
  variant?: AlertDialogVariant;
}

/**
 * Alert dialog component. Simple dialog with a title, message, and configurable buttons.
 */
@Component({
  selector: 'app-alert-dialog',
  templateUrl: './alert.dialog.html',
  styleUrls: ['./alert.dialog.scss'],
})
export class AlertDialog {
  /**
   * Passthrough to the dialog's variant enumerable.
   */
  public AlertDialogVariant = AlertDialogVariant;

  /**
   * Default constructor. Injects the dialog reference and data.
   * @param data Object to pass as data to the dialog
   * @param dialogRef Reference to dialog instance
   */
  constructor(
    @Inject(MAT_DIALOG_DATA) public data: AlertDialogData,
    private dialogRef: MatDialogRef<AlertDialog>,
  ) {
    data.variant ||= AlertDialogVariant.DEFAULT;
  }

  /**
   * Host binding to set if the dialog is important.
   */
  @HostBinding('class.important-dialog') important: boolean =
    this.data.variant === AlertDialogVariant.IMPORTANT;

  /**
   * Closes the dialog. Returns false to indicate that the dialog was closed without confirmation.
   */
  cancel() {
    this.dialogRef.close(false);
  }

  /**
   * Closes the dialog. Returns true to indicate that the dialog was closed with confirmation.
   */
  confirm() {
    this.dialogRef.close(true);
  }
}
<h1 mat-dialog-title [class.important]="data.variant === AlertDialogVariant.IMPORTANT">{{ data.title }}</h1>
<div mat-dialog-content>
  <div>{{ data.message }}</div>
</div>
<div mat-dialog-actions>
  <app-button mat-button (click)="cancel()">{{ data.cancelText }}</app-button>
  <ng-container *ngIf="data.variant === AlertDialogVariant.IMPORTANT && data.confirmText">
    <app-button mat-button (click)="confirm()" variant="important" appFocusInitial>{{ data.confirmText }}</app-button>
  </ng-container>
  <ng-container *ngIf="data.variant !== AlertDialogVariant.IMPORTANT && data.confirmText">
    <app-button mat-button (click)="confirm()" variant="primary" appFocusInitial>{{ data.confirmText }}</app-button>
  </ng-container>
</div>

import { Injectable } from '@angular/core';
import { MatDialog, MatDialogRef } from '@angular/material/dialog';
import { Project } from '@dashboard/interfaces/project.interface';
import { Workspace } from '@dashboard/interfaces/workspace.interface';
import { Task } from '@tasks/interfaces/task.interface';
import { BehaviorSubject, filter } from 'rxjs';
import { v4 as uuid } from 'uuid';
import { Service } from '../decorators/service.decorator';
import { AlertDialog, AlertDialogData, AlertDialogVariant } from '../dialogs/alert/alert.dialog';

/**
 * Service to manage dialogs.
 */
@Service()
@Injectable({
  providedIn: 'root',
})
export class DialogService {
  private dialogsMap = new Map();
  private dialogs$ = new BehaviorSubject<Map<number, MatDialogRef<unknown, any>>>(this.dialogsMap);

  public get isAnyDialogOpen() {
    return this.dialogs$.getValue().size > 0;
  }
  /**
   * Default constructor with `MatDialog` dependency.
   * @param matDialog MatDialog instance
   */
  constructor(private matDialog: MatDialog) {}

  /**
   * Opens a modal dialog containing the given component.
   * @param component Type of the component to load into the dialog.
   * @param data Object to pass as data to the dialog
   * @returns Reference to the newly-opened dialog.
   */
  open(component: any, data: any) {
    const dialog = this.matDialog.open(component, {
      data,
      width: '400px',
    });

    const uid = uuid();
    this.dialogsMap.set(uid, dialog);

    dialog.afterClosed().subscribe(() => {
      this.dialogsMap.delete(uid);
      this.dialogs$.next(this.dialogsMap);
    });

    this.dialogs$.next(this.dialogsMap);

    return dialog;
  }

  closeAll() {
    this.dialogsMap.forEach((dialog) => {
      dialog.close();
    });
  }

  /**
   * Opens a alert/information dialog.
   * @param data Object to pass as data to the dialog
   * @returns Reference to the newly-opened dialog.
   */
  alert(data: AlertDialogData) {
    return this.open(AlertDialog, data)
      .afterClosed()
      .pipe(filter((result) => result));
  }

  openErrorDialog(error: string) {
    const data: AlertDialogData = {
      title: 'Error',
      message: error,
      variant: AlertDialogVariant.IMPORTANT,
      cancelText: $localize`Close`,
    };
    return this.alert(data);
  }

  /**
   * Opens a confirm dialog.
   * @param data Object to pass as data to the dialog
   * @returns Reference to the newly-opened dialog.
   */
  confirm(data: AlertDialogData) {
    return this.alert(data);
  }

  confirmProjectDelete(project: Project) {
    return this.confirm({
      title: $localize`Delete project "${project.name}"`,
      message: $localize`Are you sure you want to delete project "${project.name}"?`,
      confirmText: $localize`Delete`,
      cancelText: $localize`Cancel`,
      variant: AlertDialogVariant.IMPORTANT,
    });
  }

  confirmWorkspaceDelete(workspace: Workspace) {
    return this.confirm({
      title: $localize`Delete workspace "${workspace.name}"`,
      message: $localize`Are you sure you want to delete this workspace "${workspace.name}"?`,
      confirmText: $localize`Delete`,
      cancelText: $localize`Cancel`,
      variant: AlertDialogVariant.IMPORTANT,
    });
  }

  confirmTaskDelete(task: Task) {
    return this.confirm({
      title: $localize`Delete task "${task.name}"`,
      message: $localize`Are you sure you want to delete this task "${task.name}"?`,
      confirmText: $localize`Delete`,
      cancelText: $localize`Cancel`,
      variant: AlertDialogVariant.IMPORTANT,
    });
  }
}

import { DialogService } from '@main/services/dialog.service';
import { Observable } from 'rxjs';

export interface ErrorValidationTree {
  [key: string]: {
    [key: number]: string;
  };
}

export function ServiceValidator(errorValidationTree: ErrorValidationTree) {
  return function (target: any, propertyKey: string, descriptor: PropertyDescriptor) {
    descriptor.value = function (identifier: string) {
      // const result = originalMethod.apply(this, identifier);

      // This function returns new observable to use it as a pipe in other observables
      return <T = any>(source: Observable<T>) => {
        // Check for match in response
        const match = (response: any) => {
          // identifier check
          if (!errorValidationTree[identifier]) return;

          // Status check
          const status = response?.error?.status || response?.status;
          if (!status) return;

          return errorValidationTree[identifier][status] || null;
        };

        const showAlert = (message: string, responseType: 'SUCCESS' | 'ERROR') => {
          const dialogService = (window as any).injector.get(DialogService);

          dialogService.alert({
            title:
              responseType === 'SUCCESS' ? $localize`Success` : $localize`Something went wrong`,
            message,
            cancelText: $localize`OK`,
          });
        };

        return new Observable<any>((subscriber) => {
          source.subscribe({
            next(value) {
              const m = match(value);

              if (m) {
                showAlert(m, 'ERROR');
              } else {
                subscriber.next(value);
              }
            },
            error(error) {
              const m = match(error);

              if (m) {
                showAlert(error, 'ERROR');
              } else {
                subscriber.error(error);
              }
            },
            complete() {
              subscriber.complete();
            },
          });
        });
      };
    };

    return descriptor;
  };
}

import { Injectable } from '@angular/core';
import { ServiceValidator } from '@main/decorators/service-validator.decorator';
import { Observable, Subject } from 'rxjs';
import { ApiService } from 'src/app/_main/services/api.service';
import { Workspace } from '../interfaces/workspace.interface';

/**
 * Workspaces management service
 */
@Injectable({
  providedIn: 'root',
})
export class WorkspaceService {
  listSubject$ = new Subject<Workspace[]>();

  /**
   * Default constructor with `ApiService` dependency.
   * @param apiService Api service
   */
  constructor(private apiService: ApiService) {}

  /**
   * Gets a workspace by its ID.
   * @param id identifier of the workspace to get from the API
   * @returns Request observable, which completes when request is finished
   */
  public get(id: number): Observable<Workspace> {
    return this.apiService.get(`/workspace/${id}`).pipe(this.validate('GET'));
  }

  /**
   * Deletes the workspace by its ID.
   * @param id identifier of the workspace to delete from the API
   * @returns Request observable, which completes when request is finished
   */
  public delete(id: number): Observable<null> {
    return this.apiService.delete(`/workspace/${id}`).pipe(this.validate('DELETE'));
  }

  /**
   * Updates a workspace.
   * @param workspace workspace object to update in the API
   * @returns Request observable, which completes when request is finished
   */
  public update(workspace: Workspace): Observable<Workspace> {
    return this.apiService.put(`/workspace/${workspace.id}`, { body: workspace });
  }

  /**
   * Lists all available workspaces.
   * @returns Request observable, which completes when request is finished
   */
  public list(): Observable<Workspace[]> {
    return this.apiService.get(`/workspace`);
  }

  /**
   * Creates a new workspace.
   * @param workspace workspace to modify
   * @returns Request observable, which completes when request is finished
   */
  public create(workspace: Workspace): Observable<Workspace> {
    return this.apiService.post(`/workspace`, { body: workspace });
  }

  @ServiceValidator({
    DELETE: {
      400: $localize`Workspace is not empty. Only empty workspaces can be deleted.`,
    },
    GET: {
      404: $localize`Workspace with this ID does not exist.`,
    },
  })
  private validate(identifier: string): any {}
}

import { Component, Input, ElementRef, ViewChild, AfterViewInit } from '@angular/core';
import { faAngleDown } from '@fortawesome/free-solid-svg-icons';
import { BehaviorSubject } from 'rxjs';

@Component({
  selector: 'app-nav-element',
  templateUrl: './nav-element.component.html',
  styleUrls: ['./nav-element.component.scss'],
})
export class NavElementComponent implements AfterViewInit {
  @Input()
  public routerLink?: string;

  @Input()
  public showOptions?: boolean;

  public active: boolean = false;

  public showArrow$: BehaviorSubject<boolean> = new BehaviorSubject<boolean>(false);

  @ViewChild('elementList')
  listElement?: ElementRef;

  faAngleDown = faAngleDown;

  constructor() {}

  public openNavElement() {
    this.active = true;
  }
  public closeNavElement() {
    this.active = false;
  }
  public toggleNavElement() {
    if (!this.active) {
      this.openNavElement();
    } else {
      this.closeNavElement();
    }
  }

  ngAfterViewInit(): void {
    setTimeout(() => {
      this.showArrow$.next(Boolean(this.listElement?.nativeElement.children.length));
    });
  }
}
<section>
  <div [routerLink]="routerLink">
    <fa-icon></fa-icon>
    <ng-content></ng-content>
  </div>
  <div class="icons">
    <div class="open-below" [class.hidden]="(showArrow$ | async) === false" (click)="toggleNavElement()">
      <app-icon [icon]="faAngleDown" size="16px" [class.active]="active"></app-icon>
    </div>
    <div class="options" [class.hidden]="!showOptions">
      <button mat-icon-button [matMenuTriggerFor]="menu" aria-label="Menu">
        <mat-icon>more_vert</mat-icon>
      </button>
      <mat-menu #menu="matMenu">
        <ng-content select=".options"></ng-content>
      </mat-menu>
    </div>
  </div>
</section>
<div class="list" #elementList [class.active]="active">
  <ng-content select=".open-below"></ng-content>
</div>

import { Injectable } from '@angular/core';
import { Workspace } from '@dashboard/interfaces/workspace.interface';
import { Service } from '@main/decorators/service.decorator';
import { map } from 'rxjs';
import { ApiService } from 'src/app/_main/services/api.service';
import { Project } from '../interfaces/project.interface';
import { WorkspaceService } from './workspace.service';

@Service()
@Injectable({
  providedIn: 'root',
})
export class ProjectService {
  constructor(private apiService: ApiService, private workspaceService: WorkspaceService) {}

  /**
   * Gets a project by its ID.
   * @param id identifier of the project to get from the API
   * @returns Request observable, which completes when request is finished
   */
  public get(projectId: number) {
    return this.apiService.get(`/project/${projectId}`);
  }

  /**
   * Deletes the project by its ID.
   * @param id identifier of the project to delete from the API
   * @returns Request observable, which completes when request is finished
   */
  public delete(projectId: number) {
    return this.apiService.delete(`/project/${projectId}`);
  }

  /**
