@Component({
  selector: 'app-upper-navigation',
  templateUrl: './upper-navigation.component.html',
  styleUrls: ['./upper-navigation.component.scss'],
})
export class UpperNavigationComponent {
  constructor(
    private dialogService: DialogService,
    private taskService: TaskService,
    private authService: AuthService,
    private router: Router,
  ) {}

  @ViewChild('openBelow') openBelow!: ElementRef<HTMLElement>;

  faAngleDown = faAngleDown;
  faUser = faUser;
  faCog = faCog;
  faSignOut = faSignOut;

  public active: boolean = false;

  createNewTask() {
    this.dialogService
      .open(TaskDialog, {
        variant: TaskDialogVariant.CREATE,
      } as TaskDialogData)
      .afterClosed()
      .subscribe((result) => {
        if (result) {
          this.taskService.create(result.projectId, result).subscribe(() => {
            location.reload();
          });
        }
      });
  }

  logout() {
    this.authService.logout().subscribe(() => {
      this.router.navigate(['/', 'auth', 'login']);
    });
  }

  public openProfile() {
    this.active = true;
    fromEvent(document, 'click')
      .pipe(skip(1), take(1))
      .subscribe(() => {
        this.closeProfile();
      });
  }

  public closeProfile() {
    this.active = false;
  }
  public toggleProfile() {
    if (!this.active) {
      this.openProfile();
    } else {
      this.closeProfile();
    }
  }
}
